import React from 'react'

function TotoItems(props){
  const todoItem = props.todoItem
  return (
      <div>
        <input type="checkbox" />
        <label for={"todoItem_" + todoItem.id}>{todoItem.todo}</label>
      </div>
  )
}

export default TotoItems
